Todays 80 mile longer ride at a new PR to almost end out week 12. Wasn‚Äôt my greatest, but I was able to completely zone out and dig deep. For me, there‚Äôs  something therapeutic about being able to sit or last 4-6 hours while biking. It‚Äôs the biggest natural high I‚Äôve ever felt, and it‚Äôs no longer just a ride once I start my Garmin. I‚Äôm sore, mentally my mind hits a wall and gives up but battling those mental thoughts for that long is a constant reminder that I‚Äôve got a massive goal that some people would never attempt to conquer. Learning along the way while staying consistent and pushing your limits is all part of the game.

First week without the coach, plan up until 11/22/2020 is set, meals are all planned and it‚Äôs just me for the next 12 weeks. Something I lack, along with people I know is trust, so from here on out that‚Äôs going to be another battle I‚Äôll have to win. It‚Äôs not the trust in other people, but more or less the lack in myself to reach my highest potential, which comes down to never being satisfied once something is completed.

